import './App.css'

const Header = (props)=>{
  return(

    <>
    <div className='head'><pre>
    <img width='90' style={{float:'left'}}  src={props.logo} alt='Logo'/> <span width='10px'></span> <h1 >Google Notes</h1></pre>
    </div>
    </>
  )
}

export default Header
